SAMPLE_RATE = 44100,
decode64 = (c, n) => (v = c.charCodeAt(n), v - (v > 92 ? 36 : 35)),
getbits = (num, start, end) => (num & (((1 << start) - 1) - ((1 << end) - 1))) >> end,
vol = val => val < 15 ? (63 / 1.25 ** val) | 0 : 0,

sq = (reg, t) => (
	real_t = t / SAMPLE_RATE,
	lim = 2 * reg * 16,
	cnt = real_t * 3579545,
	cnt % lim > lim / 2
),

getlfsrbit = (lfsr, n) => !!+lfsr[n % lfsr.length],

noise = (lfsr, rega, regb, t) => (
	table = [16, 32, 64, regb],
	val = table[rega & 3],
	real_t = t / SAMPLE_RATE,
	div = val * 2 * 16,
	cnt = real_t * 3579545 / div,
	getlfsrbit(rega & 4 ? lfsr : lfsr.substring(0, 16), cnt | 0)
),

vgmframe = (lfsr, data, t) => (
	tone0 = (decode64(data[0]) << 6) | decode64(data[1]),
	tone1 = (decode64(data[2]) << 6) | decode64(data[3]),
	tone2 = (decode64(data[4]) << 6) | decode64(data[5]),
	tone3 = decode64(data[6]),
	vol0 = decode64(data[7]),
	vol1 = decode64(data[8]),
	vol2 = decode64(data[9]),
	vol3 = decode64(data[10]),

	sq(tone0, t) * vol(vol0) +
	sq(tone1, t) * vol(vol1) +
	sq(tone2, t) * vol(vol2) +
	noise(lfsr, tone3, tone2, t) * vol(vol3)
),

vgm = (lfsr, data, t) => (
	datalen = data.length / 11,
	framenum = ((t / SAMPLE_RATE * 60) | 0) % datalen,
	vgmframe(lfsr, data.substring(framenum * 11, framenum * 11 + 11), t)
),

